import { useQuery } from "@apollo/client";
import gql from "graphql-tag";

const ALL_GUITARS_QUERY = gql`
  query ALL_GUITARS_QUERY {
    allGuitars {
      id
      name
      price
      description
      photo {
        id
        image {
          publicUrlTransformed
        }
      }
    }
  }
`;

export default function Guitars() {
    useQuery(ALL_GUITARS_QUERY);
  return (
    <div>
      <p>Guitars</p>
    </div>
  );
}
